<script>
    import jsPDF from 'jspdf'
    import 'jspdf-autotable'
    export default {
        data(){
            return{
                number:'1783', 
                date:'11-10-2021', 
                cost:137,
                products: [
                    {
                        name:"Parroi de douche",
                        quantity:1,
                        price:59,
                        total: "prixTotal"
                    },
                    {
                        name:"Cloison",
                        quantity:2,
                        price:49,
                        total: "prixTotal"
                    },
                    {
                        name:"Miroir",
                        quantity:1, 
                        price:29,
                        total: "prixTotal"
                    }
                ],
                
            }
        },
        computed:{
            /**
            * Calcul du total des articles (TODO à recalculer)
            */
            totalProduct(){
                let sum = 0;
                for (let i = 0; i < this.products.length; i++) {
                    sum += (parseFloat(this.products[i].price) * parseFloat(this.products[i].quantity));
                }
                return sum;
            }
        },
        methods: {
