                    }
                ];

                var doc = new jsPDF();

                doc.setFontSize(25);
                doc.text("FACTURE", 10, 20);

                // Indicateur vendeur
                doc.setFontSize(12);
                doc.rect(8, 25, 65, 22);
                doc.text("Informations du vendeur", 10, 30);
                doc.text("Entreprise VERRE TECH", 10, 35);
                doc.text("verretech@contact.com", 10, 40);
                doc.text("06xxxxxxxx", 10, 45);

                // Logo VERRETECH en base64
                var image = "data:image/png;base64,";
                doc.addImage(image, 'JPEG', 110, -20, 90, 70);

                // Indicateurs de commande
                doc.setFontSize(12);
                doc.text("Facture de la commande n° "+ this.number, 10, 55);
                doc.text("Date de la commande "+ this.date, 10, 60);

