                            1: { cellWidth: 30, halign: "right" },
                            2: { cellWidth: 30, halign: "right" },
                            3: { cellWidth: 20, halign: "right" },
                        },
                    }                 
                );
                // Tableau du total
                doc.autoTable({
                    tableWidth: 100,
                    styles: { halign: "center" },
                    columnStyles: {
